import React from "react";
import { IToDo } from "./atoms";

function ToDo({ text, category }: IToDo) {
  //atom에서 받아와서 체크
  return (
    <li>
      <span> {text} </span>
      {category !== "DOING" && <button>To Do</button>}
      {category !== "DOING" && <button>Doing</button>}
      {category !== "DOING" && <button>Done</button>}
    </li>
  );
}

export default ToDo;
